import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Robert</h1>
      <Todolist/>
    </div>
  );
}

const Todolist = ()=>{
  return (
    <div>
      <h3>
        What to learn
      </h3>
      <ul>
        <li>
          <input type='text'></input>
        </li>
      </ul>
    </div>
  )
}

export default App;
